import React from 'react';

import './menu.css'

export default class SideBar extends React.Component {
  render(){
    return (
      <ul disablePadding dense>
        <li button>
          <a>Home</a>
        </li>
        <li button>
          <a>Billing</a>
        </li>
        <li button>
          <a>Settings</a>
        </li>
      </ul>
    )
  }
}
